\fs20\par
\fs28    Pulmonary hypertension (PHT) is a common complication in patients with sickle cell disease (SCD), with a reported prevalence of approximately 30%.[1-4] Multiple studies have shown that PHT is associated with increased mortality in SCD patients.[2, 4-7] The pathogenesis of PHT in SCD is probably due to a variety of factors. Recent evidence suggests a central role for chronic intravascular hemolysis, with associated scavenging of nitric oxide by cell-free plasma hemoglobin.[4,8,9] Arginase, which converts L-arginine (the substrate for nitric oxide synthesis) to ornithine, is also released following hemolysis.[10] Elevated arginase activity, and the resultant decrease in the arginine/ornithine ratio, is associated with PHT in SCD.[4,11] Although various studies have found no association between PHT and a history of acute chest syndrome,[3,4] chronic lung injury resulting from repeated episodes of acute chest syndrome may lead to the development of PHT due to chronic fibrotic pulmonary parenchymal damage, altered vascular tone, vascular proliferation, hypoxia and consequent pulmonary vasculopathy. Finally, pulmonary thromboembolism[12, 13] and progressive endothelial damage with concentric pulmonary vascular intimal hyperplasia and \i in situ\i0  thrombosis[13,14] may also contribute to the pathogenesis of PHT in SCD. The aim of the present study was to determine whether coagulation activation and inflammation are associated with PHT in SCD. Furthermore, we aimed to assess correlations between measures of coagulation activation and inflammation with markers of hemolysis. To address these questions, we evaluated a cohort of patients followed at an adult Sickle Cell Clinic.\f1\par
